	stwa	%l0, [%o6 + BLIMP_BIAS32 + (4*0)]%asi
	stwa	%l1, [%o6 + BLIMP_BIAS32 + (4*1)]%asi
	stwa	%l2, [%o6 + BLIMP_BIAS32 + (4*2)]%asi
	stwa	%l3, [%o6 + BLIMP_BIAS32 + (4*3)]%asi
	stwa	%l4, [%o6 + BLIMP_BIAS32 + (4*4)]%asi
